import React from 'react';

class Home extends React.Component {
  render() {
    const containerStyle = {  
        position: 'relative',
        textAlign: 'center',
        color: 'white',
        overflow: 'hidden',
    };

    const centeredStyle = {
        position: 'absolute',
        top: '50%',
        left: '50%',
    };

    const imageSrc = 'https://cdn.realestateview.com.au/illuminate/images/1024-max/wp_advice_1674-b-0-110e376206e6c6.jpeg';

    return (
      <div className="imgContainer" style={containerStyle}>
        <img src={imageSrc}style={{ width: '100%', height: '100%', display: 'block'}} />
        {/* <div className="centered" style={centeredStyle}>
          Centered
        </div> */}

<div className="container mt-5">
        <h1 className="text-center">What is Ranter?</h1>
        <p className="text-center">Are you tired of struggling to find the perfect rental property? Look no further than Ranter! Our platform provides tenants with the most current and authentic reviews from previous renters, helping you to find your ideal home. Say goodbye to the guesswork and frustration of the rental search process and say hello to the ease and convenience of Ranter!</p>
      </div>
      </div>
    );
  }
}

export default Home;
